import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { Container, Row, Col, Card, Badge, Alert, Spinner } from 'react-bootstrap';
import { testsAPI } from '../services/api';

function TestResults() {
  const { token } = useParams();
  const [results, setResults] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    loadResults();
  }, [token]);

  const loadResults = async () => {
    try {
      const response = await testsAPI.getResults(token);
      setResults(response.data);
    } catch (error) {
      setError('Failed to load test results');
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <Container>
        <div className="loading-spinner">
          <Spinner animation="border" role="status">
            <span className="visually-hidden">Loading results...</span>
          </Spinner>
        </div>
      </Container>
    );
  }

  if (error) {
    return (
      <Container>
        <Alert variant="danger">{error}</Alert>
      </Container>
    );
  }

  const { session, answers, statistics } = results;
  const scorePercentage = parseFloat(statistics.percentage);
  
  const getScoreClass = (percentage) => {
    if (percentage >= 80) return 'score-excellent';
    if (percentage >= 60) return 'score-good';
    return 'score-poor';
  };

  const getGrade = (percentage) => {
    if (percentage >= 90) return 'A+';
    if (percentage >= 80) return 'A';
    if (percentage >= 70) return 'B+';
    if (percentage >= 60) return 'B';
    if (percentage >= 50) return 'C';
    return 'F';
  };

  return (
    <Container>
      <Row>
        <Col lg={10} className="mx-auto">
          <Card className="mb-4">
            <Card.Header className="bg-primary text-white">
              <h4 className="mb-0">Test Results</h4>
            </Card.Header>
            <Card.Body>
              <Row>
                <Col md={8}>
                  <h5>{session.candidate_name}</h5>
                  <p className="text-muted mb-1">Email: {session.candidate_email}</p>
                  <p className="text-muted mb-0">
                    Test completed on: {new Date(session.completed_at).toLocaleString()}
                  </p>
                </Col>
                <Col md={4} className="text-center">
                  <div className={`score-circle mx-auto ${getScoreClass(scorePercentage)}`}>
                    {scorePercentage}%
                  </div>
                  <h4 className="mt-2">Grade: {getGrade(scorePercentage)}</h4>
                </Col>
              </Row>
            </Card.Body>
          </Card>

          <Row className="mb-4">
            <Col md={3}>
              <Card className="text-center">
                <Card.Body>
                  <h5 className="text-primary">{statistics.total_questions}</h5>
                  <p className="mb-0">Total Questions</p>
                </Card.Body>
              </Card>
            </Col>
            <Col md={3}>
              <Card className="text-center">
                <Card.Body>
                  <h5 className="text-success">{statistics.correct_answers}</h5>
                  <p className="mb-0">Correct Answers</p>
                </Card.Body>
              </Card>
            </Col>
            <Col md={3}>
              <Card className="text-center">
                <Card.Body>
                  <h5 className="text-danger">
                    {statistics.total_questions - statistics.correct_answers}
                  </h5>
                  <p className="mb-0">Incorrect Answers</p>
                </Card.Body>
              </Card>
            </Col>
            <Col md={3}>
              <Card className="text-center">
                <Card.Body>
                  <h5 className="text-info">{statistics.percentage}%</h5>
                  <p className="mb-0">Final Score</p>
                </Card.Body>
              </Card>
            </Col>
          </Row>

          <h5 className="mb-3">Detailed Results</h5>
          {answers.map((answer, index) => (
            <Card key={answer.id} className="results-card">
              <Card.Body>
                <div className="d-flex justify-content-between align-items-start mb-3">
                  <h6 className="mb-0">Question {index + 1}</h6>
                  <Badge bg={answer.is_correct ? 'success' : 'danger'}>
                    {answer.is_correct ? 'Correct' : 'Incorrect'}
                  </Badge>
                </div>
                
                <p><strong>Question:</strong> {answer.question_text}</p>
                
                <div className="mb-2">
                  <strong>Your Answer:</strong>
                  <div className="p-2 bg-light rounded mt-1">
                    {answer.candidate_answer || 'No answer provided'}
                  </div>
                </div>
                
                <div>
                  <strong>Correct Answer:</strong>
                  <div className="p-2 bg-success bg-opacity-10 rounded mt-1">
                    {answer.correct_answer}
                  </div>
                </div>
              </Card.Body>
            </Card>
          ))}
        </Col>
      </Row>
    </Container>
  );
}

export default TestResults;
